var today=new Date();var todayString=(today.toDateString());function formatSeconds(b){var a=new Date(1970,0,1);a.setSeconds(b);return a.toTimeString().replace(/.*(\d{2}:\d{2}).*/,"$1")}function formatMilliseconds(a){var b=new Date(1970,0,1);b.setMilliseconds(a);if(a>3600000){return b.toTimeString().replace(/.*(\d{2}:\d{2}:\d{2}).*/,"$1")}else{return b.toTimeString().replace(/.*(\d{2}:\d{2}).*/,"$1")}}function getMsSinceMidnight(b){var a=new Date(b);return b-a.setHours(0,0,0,0)}function streakCalc(a,b,c){if(b>a-getMsSinceMidnight(a)){console.log("You already did one today");return newStreak=c}else{if(b>(a-getMsSinceMidnight(a)-86400000)){console.log("Streak ++");return newStreak=c+1}else{return newStreak=1}}}$(".alert-dismiss").click(function(){$(this).parent().fadeOut()});